function ModalYesNoClick(n,t,i,r,u,f,e,o){bootbox.dialog({message:n,title:t,buttons:{save:{label:i,className:r,callback:function(){u()}},cancel:{label:f,className:e,callback:function(){o!=null&&o()}}}})}function ModalConfirmClick(n,t,i,r,u,f,e,o,s,h,c){bootbox.dialog({message:n,title:t,buttons:{save:{label:i,className:r,callback:function(){u()}},cancel:{label:f,className:e,callback:function(){o()}},main:{label:s,className:h,callback:function(){c()}}}})}function Modaldialog(n,t,i,r){bootbox.dialog({message:n,title:t,backdrop:!0,buttons:{cancel:{label:i,className:r}}})}function ModalPrompt(n,t,i,r){bootbox.prompt({title:n,value:t,callback:function(n){Maincallback(n)},buttons:{confirm:{label:i},cancel:{label:r}}})}